Rhynchodes ursus, the elephant weevil (From Rhyncho meaning snout/beak and ursus being bear) basically is the Elephant bear. 

Found across NZ. Adult weevils are found on trees, where they gather to feed on sap. Larvae tunnel into dead trunks and branches of southern beeches, rimu and Dracophyllum traversii. This large weevil has a deep brown colour with two lighter bands near the side of its thorax. It has black legs with a spot of yellowish-brown hairs on each femur. It has dense scales on its body, which can be hair-like. In female specimens the antennae are inserted halfway along the rostrum and nearer the front in males. (Wiki)

The larvae of Rhynchodes ursus are the host of New Zealand's largest parasitic wasp, Certonotus fractinervis. Female wasps use a long ovipositor to lay eggs inside the larvae whilst they develop inside trees. (Wiki)

